import './App.css'
import HomePage from "./HomePage";
import Footer from "./Components/Footer";
import Header from "./Components/Header";
import {BackgroundProvider} from './Contexts/BackgroundContext.tsx';
import { injectSpeedInsights } from '@vercel/speed-insights';
import {LanguageProvider} from "./Contexts/LanguageContext.tsx";
import {Analytics} from "@vercel/analytics/react";
import {TimeProvider} from "./Contexts/TimeContext.tsx";
import {WeatherProvider} from "./Contexts/WeatherContext.tsx";
import {ThemeSettingsProvider} from "./Contexts/ThemeSettingsContext.tsx";
import {useEffect} from "react";

function showConsoleEasterEgg() {
    const base64ImageUrl = 'data:image/png;base64,'
    const imageStyles = [
        `background-image: url(${base64ImageUrl})`,
        'background-size: contain',
        'background-repeat: no-repeat',
        'padding: 269px 187px',
        'line-height: 0px',
    ].join(';');
    console.log('%c ', imageStyles);

    const textStyles = [
        'font-family: monospace',
        'font-size: 1.2em',
        'font-weight: bold',
    ].join(';');

    console.log('%cOne must imagine the developer happy.', textStyles);
}

const styles = `
  /* Base transitions for theme changes */
  * {
    transition: color 0.4s ease-out,
              background-color 1.2s ease-out,
              border-color 1.2s ease-out,
              text-decoration-color 0.8s ease-out,
              fill 3s ease-out,
              stroke 1.8s ease-out;
  }`

function App() {

    useEffect(() => {
        // Only run this in a browser environment
        if (typeof window !== 'undefined') {
            showConsoleEasterEgg();
        }
    }, []);

    injectSpeedInsights(); //for vercel

    return (
        <ThemeSettingsProvider>
            <WeatherProvider>
                <TimeProvider>
                    <BackgroundProvider>
                        <LanguageProvider>
                            <style>{styles}</style>
                            <div>
                                    <Header/>
                                    <HomePage/>
                                    <Footer/>
                            </div>
                        </LanguageProvider>
                        <Analytics/>
                    </BackgroundProvider>
                </TimeProvider>
            </WeatherProvider>
        </ThemeSettingsProvider>
    );
}

export default App;